import { useSelector } from "react-redux"

const FilterList = () => {
    const { filters } = useSelector(state => state.filter)

    return (
        <div>
            <h1>Filters</h1>
            {filters.map((filter) => {
                return <>{filter.criterion}: {filter.min}-{filter.max} <button>x</button></>
            })}
        </div>
    )
}

export default FilterList
